import React, {Component} from "react";

export class Signup extends Component {
	render() {
		handleSubmit = (event) => {
			event.preventDefault();
		};

		return (
			<div>
				<form onSubmit={this.handleSubmit}>
					<label> Name: </label>
					<input type="text" />
					<label>Password: </label>
					<input type="password" />
				</form>
			</div>
		);
	}
}

export default Signup;
